class Direction(Enum):
    UP = 0
    DOWN = 1
    LEFT = 2
    RIGHT = 3

def is_connectable(position, from_direction):
    row, col = position[0], position[1]
    if row < 0 or row >= MAP_NUM_ROW or col < 0 or col >= MAP_NUM_COL:
        return False

    if from_direction == Direction.UP and _map[row][col] in ['|', 'J', 'L','S']:
        return True
    if from_direction == Direction.RIGHT and _map[row][col] in ['-', 'L', 'F','S']:
        return True
    if from_direction == Direction.DOWN and _map[row][col] in ['|', '7', 'F','S']:
        return True
    if from_direction == Direction.LEFT and _map[row][col] in ['-', 'J', '7','S']:
        return True
    return False

def is_start(position):
    row, col = position[0], position[1]
    if row < 0 or row >= MAP_NUM_ROW or col < 0 or col >= MAP_NUM_COL:
        return False

    if _map[row][col] == 'S':
        return True
    
    return False

def get_next_position(position, direction):
    row, col = position[0], position[1]
    if direction == Direction.UP:
        return (row-1, col)
    if direction == Direction.RIGHT:
        return (row, col+1)
    if direction == Direction.DOWN:
        return (row+1, col)
    if direction == Direction.LEFT:
        return (row, col-1)

def get_value(position):
    row, col = position[0], position[1]
    if row < 0 or row >= MAP_NUM_ROW or col < 0 or col >= MAP_NUM_COL:
        return None
    return _map[row][col]

def get_map_copy_value(position):
    row, col = position[0], position[1]
    if row < 0 or row >= MAP_NUM_ROW or col < 0 or col >= MAP_NUM_COL:
        return None
    return map_copy[row][col]

def get_from_direction(next_direction):
    if next_direction == Direction.UP:
        from_direction = Direction.DOWN
    if next_direction == Direction.RIGHT:
        from_direction = Direction.LEFT
    if next_direction == Direction.DOWN:
        from_direction = Direction.UP
    if next_direction == Direction.LEFT:
        from_direction = Direction.RIGHT
    return from_direction

directions = [Direction.UP, Direction.RIGHT, Direction.DOWN, Direction.LEFT]


pending_evaluate = []

traverse_dict = {}

def traverse(position, from_direction):
    print(f'traverse({position}, {from_direction})')
    row, col = position[0], position[1]
    if row < 0 or row >= MAP_NUM_ROW or col < 0 or col >= MAP_NUM_COL:
        return 0

    map_copy[row][col] = 'X'

    if _map[row][col] == 'S':
        traverse_dict[position] = 0
        return 0
    
    if (_map[row][col] == 'J' and from_direction == Direction.LEFT) or (_map[row][col] == 'L' and from_direction == Direction.RIGHT) or (_map[row][col] == '|' and from_direction == Direction.DOWN):
        distance = 1 + traverse(get_next_position(position, Direction.UP), Direction.DOWN)
        traverse_dict[position] = distance
        return distance
    if (_map[row][col] == '7' and from_direction == Direction.LEFT) or (_map[row][col] == 'F' and from_direction == Direction.RIGHT) or (_map[row][col] == '|' and from_direction == Direction.UP):
        distance = 1 + traverse(get_next_position(position, Direction.DOWN), Direction.UP)
        traverse_dict[position] = distance
        return distance
    if (_map[row][col] == 'J' and from_direction == Direction.UP) or (_map[row][col] == '7' and from_direction == Direction.DOWN) or (_map[row][col] == '-' and from_direction == Direction.RIGHT):
        distance = 1 + traverse(get_next_position(position, Direction.LEFT), Direction.RIGHT)
        traverse_dict[position] = distance
        return distance
    if (_map[row][col] == 'L' and from_direction == Direction.UP) or (_map[row][col] == 'F' and from_direction == Direction.DOWN) or (_map[row][col] == '-' and from_direction == Direction.LEFT):
        distance = 1 + traverse(get_next_position(position, Direction.RIGHT), Direction.LEFT)
        traverse_dict[position] = distance
        return distance


