def is_inside(position, loop):
    row, col = position[0], position[1]
    crosses = 0
    for j in range(col + 1, m+1):
        new_pos = (row, j)
        last_pos = (row, j-1)
        if new_pos in loop and last_pos in loop and new_pos in g.edges[last_pos]:
            continue
        if last_pos in loop:
            exited = last_pos
            edge_up = False
            edge_down = False
            for node in [entered, exited]:
                node_row, code_col = node[0], node[1]
                if (node_row-1, code_col) in g.edges[node]:
                    edge_up = True
                if (node_row+1, code_col) in g.edges[node]:
                    edge_down = True
            if edge_up and edge_down:
                crosses += 1
        if new_pos in loop:
            entered = new_pos
    return (crosses % 2) == 1

